import React from 'react';
import { Box, Card, CardActions, CardContent, CardMedia, Button, Typography } from '@mui/material';
const CardHome = ({ data }) => {
    console.log(data)
    return (
        <Box>
            <Card>
                <CardMedia
                    component="img"
                    alt="This is product"
                    height="140"
                    image=""
                />
            </Card>
        </Box>
    )
};

export default CardHome;
